import React, { Component } from 'react';
import {data} from './columns';

export const Table = () => {
  return (
    <>
      <div className="stock-container">
        {data.map((data, key) => {
          return (
            <div key={key}>
              <BaseTable
                key={key}
                ablbum={data.album}
                year={data.year}
                post={data.US_peak_chart_post}
              />
            </div>
          );
        })}
      </div>
    </>
  );
};
const BaseTable = ({album, year, post}) => {
  return (
    <table>
      <tbody>
        <tr>
          <td>
            <h5>{album}</h5>
          </td>
          <td>
            <h5>{year}</h5>
          </td>
          <td>
            <h4>{post}</h4>
          </td>
        </tr>
      </tbody>
    </table>
  );
}
 
export default BaseTable;
